description:
Kalyanaraman (2002) Malayalam Movie - DVDRip - Team Rjaa

Kalyanaraman is a 2002 Malayalam romantic comedy film directed by Shafi starring Dileep and Navya Nair. The film was remade in Telugu as Kalyanaramudu(2003) starring Venu, Suman, Prabhudeva and Nikita Thukral.

Directed by	Shafi
Produced by	Lal
Written by	Benny P. Nayarambalam
Starring	Dileep
Navya Nair
Music by	Berny Ignatius
Cinematography	P. Sukumar
Editing by	Harihara Puthran
Release date(s)	2002
Country	India
Language	Malayalam

